document.addEventListener("keydown", function (event) {
  if (event.ctrlKey && event.shiftKey && event.key.toLowerCase() === "b") {
    if (!document.getElementById("cstmNodesoundboardIfame")) {
      const iframe = document.createElement("iframe");
      iframe.id = "cstmNodesoundboardIfame";
      iframe.style.width = "360px";
      iframe.style.height = "340px";
      iframe.style.border = "2px solid #8A2BE2";
      iframe.style.borderRadius = "10px";
      iframe.style.position = "fixed";
      iframe.style.top = "50%";
      iframe.style.left = "50%";
      iframe.style.transform = "translate(-50%, -50%)";
      iframe.style.background = "#2D1B5A";
      iframe.style.zIndex = "1000";
      document.body.appendChild(iframe);

      iframe.srcdoc = `
        <html>
        <head>
          <title>Node Soundboard</title>
        </head>
        <style>
          body {
            background: #2D1B5A;
            color: #E0B0FF;
            font-family: Arial, sans-serif;
            text-align: center;
            padding: 10px;
            position: relative;
          }
          #closeBtn {
            position: absolute;
            top: 5px;
            right: 8px;
            background: #E74C3C;
            color: white;
            border: none;
            font-size: 14px;
            padding: 4px 8px;
            border-radius: 50%;
            cursor: pointer;
          }
          button {
            padding: 6px 12px;
            font-size: 14px;
            background: #8A2BE2;
            color: white;
            border: none;
            cursor: pointer;
            border-radius: 5px;
            margin-top: 5px;
          }
          #container {
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 8px;
            margin-top: 10px;
          }
          .event-box {
            display: flex;
            gap: 8px;
            align-items: center;
          }
          .sound-select {
            font-size: 14px;
            background: #4B0082;
            color: white;
            border: none;
            border-radius: 4px;
            padding: 4px 6px;
          }
          .event-input {
            padding: 4px;
            border-radius: 4px;
            border: 1px solid #aaa;
            background: #4B0082;
            color: white;
            width: 100px;
          }
        </style>
        <body>
          <button id="closeBtn">X</button>
          <button id="addBtn">Add</button>
          <div id="container"></div>

          <script>
            const soundOptions = ["bark", "click", "explosion", "kick", "laugh", "laugh2", "quack", "surprise", "sus", "thud-bass", "what"];
            const STORAGE_KEY = "customNodeSoundboardData";

            document.getElementById("closeBtn").addEventListener("click", function () {
              saveToStorage();
              let iframe = parent.document.getElementById("cstmNodesoundboardIfame");
              if (iframe) parent.document.body.removeChild(iframe);
            });

            document.getElementById("addBtn").addEventListener("click", function () {
              createEventBox("", "bark");
            });

            function createEventBox(name, sound) {
              let container = document.getElementById("container");

              let div = document.createElement("div");
              div.className = "event-box";

              let input = document.createElement("input");
              input.type = "text";
              input.className = "event-input";
              input.placeholder = "Event Name";
              input.value = name;

              let select = document.createElement("select");
              select.className = "sound-select";

              soundOptions.forEach((opt) => {
                let option = document.createElement("option");
                option.value = opt;
                option.textContent = opt;
                if (opt === sound) option.selected = true;
                select.appendChild(option);
              });

              let removeBtn = document.createElement("button");
              removeBtn.innerText = "X";
              removeBtn.addEventListener("click", () => {
                container.removeChild(div);
              });

              div.appendChild(input);
              div.appendChild(select);
              div.appendChild(removeBtn);
              container.appendChild(div);
            }

            function saveToStorage() {
              let data = [];
              document.querySelectorAll(".event-box").forEach((box) => {
                const name = box.querySelector("input").value.trim();
                const sound = box.querySelector("select").value;
                if (name) {
                  data.push({ name, sound });
                }
              });
              localStorage.setItem(STORAGE_KEY, JSON.stringify(data));
            }

            function loadFromStorage() {
              const raw = localStorage.getItem(STORAGE_KEY);
              if (!raw) return;
              try {
                const parsed = JSON.parse(raw);
                parsed.forEach(({ name, sound }) => {
                  createEventBox(name, sound);
                });
              } catch (e) {
                console.error("Invalid stored soundboard data");
              }
            }

            loadFromStorage();
          </script>
        </body>
        </html>
      `;
    }
  }
});

const soundEffects = {
  bark: "data:audio/mpeg;base64,",
  click:
    "data:audio/mpeg;base64,",
  explosion:
    "data:audio/mpeg;base64,",
  kick: "data:audio/mpeg;base64,",
  laugh:
    "data:audio/mpeg;base64,",
  laugh2:
    "data:audio/mpeg;base64,",
  quack:
    "data:audio/mpeg;base64,",
  surprise:
    "data:audio/mpeg;base64,",
  sus: "data:audio/mpeg;base64,",
  "thud-bass":
    "data:audio/mpeg;base64,",
  what: "data:audio/mpeg;base64,",
};

function playSound(soundName) {
  const sound = soundEffects[soundName];
  if (!sound) {
    console.warn(`Sound '${soundName}' not found in soundEffects.`);
    return;
  }

  const audio = new Audio(sound); // sound is already a data URL
  audio.play().catch((err) => {
    console.error("Audio play failed:", err);
  });
}

runtimeScene.getObjects("music_container").forEach((obj) => {
  // Load your saved data
  const savedEvents = JSON.parse(
    localStorage.getItem("customNodeSoundboardData") || "[]"
  );
  if (
    gdjs.RuntimeObject.collisionTest(
      obj,
      runtimeScene.getObjects("play_node")[0],
      true
    )
  ) {
    const eventName = obj.getVariables().get("data").getAsString();
    const match = savedEvents.find((entry) => entry.name === eventName);

    if (match) {
      console.log(`Matched: ${match.name}, sound: ${match.sound}`);
      if (runtimeScene.getOnceTriggers().triggerOnce(1)) {
        playSound(match.sound);
      }
    } else {
      console.log(`No match for: ${eventName}`);
    }
  }
});
